import { BrowserRouter } from 'react-router-dom';
import React from 'react';
import App from './App';


ReactDOM.hydrate(
    <React.StrictMode>
        <BrowserRouter>
            <App />
        </BrowserRouter>
    </React.StrictMode>,
    document.getElementById("root")
);

if (module.hot) {
    module.hot.accept();
}
